import React, {useState} from "react";

export const Route = ({route}) => {
    const [show, setShow] = useState(false);

    const handleClick = () => {
        setShow(!show)
    }
    return <div>
        <button onClick={{handleClick}}>
            <h4 key={route.id} >{route.name}</h4>
            {show ? <h4>hi</h4>: <></>}
        </button>
    </div>
};
